import React from "react";
import {View, Text,Image} from "react-native";

export default function Login (){
    return (
        <View style={{
            flex: 1,
            width: 200,
            height: 200,
        }}>
            <Image
            source={require("../assets/images/good.jpg")}/>

        

        </View>
    );
}
